import { Button, View, Text } from "react-native";
import TreeView from 'react-native-final-tree-view'

function getIndicator(isExpanded, hasChildrenNodes) {
    if (!hasChildrenNodes) {
      return '-'
    } else if (isExpanded) {
      return '\\/'
    } else {
      return '>'
    }
  }

